import React from 'react';
import logo from './logo.svg';
import './App.css';
import loginComp from './components/login';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

          <section className="components">
        <loginComp/>
          </section>

      </header>
    </div>
  );
}

export default App;
